    form.addEventListener("submit", event => {
      const email = document.getElementById("ed_email").value,
        password = document.getElementById("ed_password").value;

      console.log("email : ", email);
      console.log("password : ", password);
      event.preventDefault();
      fetch("http://localhost:3000/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/x-www-form-urlencoded"
        },
        body: `email=${email}&password=${password}`
      }).then(response => {
          console.log("Password is",response.ok)
      });
    });
  }*/

  render() {
    return (
      <main>
        <nav style={{display:"flex"}}>
          <div>
            <img src="./Petrokimia_Gresik_logo.svg" />
          </div>
          <div style={{justifySelf: "flex-end"}}>
            <a href="../Login">Login</a>
            <a href="../DaftarBarang">Daftar Barang</a>
            <a href="../Panduan">Panduan</a>
          </div>
        </nav>
        <style jsx global>{`
          body {
            background: #3ec400;
            font-family: "Open Sans", sans-serif;
            margin: 0 auto;
          }

          div {
            margin: 0 auto;
            display: block;
          }

          main {
            display: grid;
            grid-template-columns: 1fr 1fr;
            font-family: "Open Sans", sans-serif;
          }

          .divLogo {
            width: 100%;
            margin: 0 auto;
            height: 140px;
          }

          #logo_petro {
            background: #ffffff;
            width: 30%;
            margin-top: 3%;
            margin-left: 3%;
            margin-bottom: 3%;
          }

          .inventaris {
            width: 50%;
            margin: 0 auto;
            margin-left: 0%;
            margin-top: 20%;
          }

          .pt {
            width: 100%;
            margin: 0 auto;
            margin-left: 0%;
            font-size: 30px;
          }
        `}</style>
      </main>
    );
  }
}

export default Dashboard;
